eval("__webpack_require__.r(__webpack_exports__);\n/* harmony export */ __webpack_require__.d(__webpack_exports__, {\n/* harmony export */   posts: () => (/* binding */ posts)\n/* harmony export */ });\nconst posts = [\n    {\n        id: 1,\n        title: \"AI: Your New Artsy Bestie\",\n        category: \"Tech\",\n        content: \"Who needs human creativity when you've got AI, right? Wrong! AI is here to amplify your artistic genius, not replace it. Imagine a world where your digital paintbrush is powered by machine learning, creating strokes you never thought possible. It's like having a hyper-caffeinated art assistant that never sleeps and doesn't steal your snacks. So, embrace the future, and let AI be the Robin to your Batman in the art world!\"\n    },\n    {\n        id: 2,\n        title: \"Crypto: Digital Gold or Fool's Gold?\",\n        category: \"Finance\",\n        content: \"Ah, cryptocurrency – the financial world's equivalent of a rollercoaster designed by a mad scientist. One day you're on top of the world, the next you're wondering if you can trade your digital coins for a cup of coffee. Is it the future of money or just a glorified game of digital hot potato? Buckle up, buttercup, because in this wild west of finance, the only thing more volatile than the market is the opinions of self-proclaimed crypto gurus!\"\n    },\n    {\n        id: 3,\n        title: \"Data Visualization: Making Numbers Pretty\",\n        category: \"Art\",\n        content: \"Ever tried to make sense of a spreadsheet and felt like you're decoding an alien language? Enter data visualization – the art of turning boring numbers into eye candy. It's like giving your data a makeover, transforming it from a plain Jane into a runway model. Suddenly, those mind-numbing statistics become a thrilling visual story. Who knew pie charts could be so delicious?\"\n    },\n    {\n        id: 4,\n        title: \"The Internet of Things: When Your Toaster Gets Smarter Than You\",\n        category: \"Tech\",\n        content: \"Welcome to the future, where your fridge judges your eating habits and your toaster has an existential crisis. The Internet of Things is turning every gadget in your home into a chatterbox. Soon, you'll be arguing with your smart thermostat about the perfect temperature while your AI-powered vacuum plots world domination. Just remember, when the robot uprising begins, it'll probably start with your smart coffee maker refusing to brew your morning joe!\"\n    },\n    {\n        id: 5,\n        title: \"NFTs: Digital Beanie Babies or the Future of Art?\",\n        category: \"Art\",\n        content: \"NFTs are the art world's latest craze – because apparently, we needed a way to make digital art as pretentious as the real thing. It's like buying air guitar, but with a certificate of authenticity. Are they the future of art ownership or just a way for people to brag about owning a JPEG? Only time will tell if these digital collectibles will be the next Mona Lisa or end up in the virtual garage sale of history.\"\n    },\n    {\n        id: 6,\n        title: \"Blockchain: Solving Problems You Didn't Know You Had\",\n        category: \"Finance\",\n        content: \"Blockchain is like the Swiss Army knife of the digital world – it claims to solve everything from financial fraud to bad hair days. It's a magical ledger that promises to make middlemen obsolete, which is great news for everyone except, well, middlemen. Will it revolutionize the world or just give tech bros something new to brag about at parties? Either way, it's got more chains than a rapper in the 90s!\"\n    },\n    {\n        id: 7,\n        title: \"Machine Learning: Teaching Computers to Think (What Could Go Wrong?)\",\n        category: \"Tech\",\n        content: \"Machine learning is like raising a digital child – you feed it data, teach it the ways of the world, and hope it doesn't decide to take over the planet. It's all fun and games until your AI starts outsmarting you at chess or questioning the meaning of life. Just remember, when your smart home starts making snarky comments about your Netflix choices, you only have yourself to blame!\"\n    },\n    {\n        id: 8,\n        title: \"The Gig Economy: Because Who Needs Job Security Anyway?\",\n        category: \"Finance\",\n        content: \"Welcome to the gig economy, where every day is a hustle and your office is wherever you can find Wi-Fi. It's the perfect solution for those who find stable employment and benefits just too boring. Why have one steady job when you can juggle seventeen different gigs and still barely make rent? But hey, at least you can work in your pajamas and call yourself an 'entrepreneur' on Instagram!\"\n    }\n];\n//# sourceURL=[module]\n//# sourceMappingURL=data:application/json;charset=utf-8;base64,\n//# sourceURL=webpack-internal:///(rsc)/./app/data/posts.ts\n");

